INSERT INTO `hero` VALUES (1, '李大钊', 1, '1889—1927', '中国共产党创立者之一', '我们之加入本党，是为有所贡献于本党以贡献于国民革命的事业而来的', '中国共产党创立者之一，其与陈独秀同为中共主要创始人，有“南陈北李”之称。', '李大钊（1889年10月29日—1927年4月28日），字守常，直隶省乐亭县（今属河北省唐山市）人[1]:3309。中国最早的马克思主义者之一，中国共产党早期领导人之一[1]:3309。1913年天津法政专门学校毕业后，去日本早稻田大学读书[1]:3309。曾参加反袁世凯运动[1]:3309。李大钊是中国国民党第一届中央执行委员会委员之一，也是在国共第一次合作、国民革命军北伐时期推翻北洋政府的主要角色之一，同时为共产国际的成员及其在中国的代理人。1927年，因被北洋政府指控其裹通苏联颠覆中华民国北洋政府被捕，后被北洋政府督军统帅兼代理总统职权的张作霖判处绞刑。', 1927, 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/4c/1930_Li_Dazhao_Chinese_comintern.jpg/250px-1930_Li_Dazhao_Chinese_comintern.jpg', 0, 1, '2025-06-03 16:48:56', '2025-06-03 16:48:56', NULL, NULL, 0);
INSERT INTO `hero` VALUES (2, '夏明翰', 1, '1921-1949', '革命烈士', '砍头不要紧，只要主义真。', '坚定的革命者，为中国革命事业英勇献身。', '被捕后坚贞不屈，在狱中写下就义诗，后被国民党反动派杀害，年仅28岁。', 1928, 'https://bkimg.cdn.bcebos.com/pic/32fa828ba61ea8d3614a556f950a304e251f5874?x-bce-process=image/format,f_auto/quality,Q_70/resize,m_lfit,limit_1,w_536', 2, 1, '2025-06-08 22:34:43', '2025-06-08 22:34:43', NULL, NULL, 0);
INSERT INTO `hero` VALUES (3, '黄继光', 2, '1950-1978', '志愿军战斗英雄', '为了胜利，舍生忘死。', '在抗美援朝战场上舍身堵枪眼，保卫祖国荣誉。', '在上甘岭战役中，为掩护部队进攻，用胸膛堵住敌人机枪口，壮烈牺牲。', 1952, 'https://bkimg.cdn.bcebos.com/pic/0b7b02087bf40ad162d901964f6706dfa9ec8a136038?x-bce-process=image/format,f_auto/quality,Q_70/resize,m_lfit,limit_1,w_536', 3, 1, '2025-06-08 22:35:10', '2025-06-08 22:35:10', NULL, NULL, 0);
INSERT INTO `hero` VALUES (4, '恽代英', 1, '1921-1949', '青年运动先驱', '革命者光明磊落，杀我恽代英，还有后来人！', '中国共产党早期领导人，青年运动和宣传工作的积极推动者。', '曾任中共中央宣传部长，积极从事革命宣传与组织工作，1931年被捕后英勇就义。', 1931, 'https://bkimg.cdn.bcebos.com/pic/b58f8c5494eef01f3a29ee4c59b28e25bc315d60d7af?x-bce-process=image/format,f_auto/quality,Q_70/resize,m_lfit,limit_1,w_536', 3, 1, '2025-06-08 22:38:23', '2025-06-08 22:38:23', NULL, NULL, 0);
INSERT INTO `hero` VALUES (5, '方志敏', 1, '1921-1949', '坚定的共产主义战士', '敌人只能砍下我们的头颅，决不能动摇我们的信仰！', '著有《可爱的中国》，表达了对祖国和人民的无限热爱。', '领导闽浙赣苏区革命斗争，1935年被俘后坚贞不屈，被敌人杀害。', 1935, 'https://bkimg.cdn.bcebos.com/pic/5366d0160924ab18972b68e93fb4f1cd7b899f519d95?x-bce-process=image/format,f_auto/quality,Q_70/resize,m_lfit,limit_1,w_536', 4, 1, '2025-06-08 22:38:54', '2025-06-08 22:38:54', NULL, NULL, 0);
INSERT INTO `hero` VALUES (6, '赵一曼', 1, '1921-1949', '东北抗日巾帼英雄', '未惜头颅新故国，甘将热血沃中华。', '女共产党员，英勇参加东北抗日游击战争，被捕后惨遭酷刑仍不屈不挠。', '被捕后在敌人酷刑下坚守信念，最终被日军杀害，年仅31岁。', 1936, 'https://bkimg.cdn.bcebos.com/pic/e7cd7b899e510fb3ef71bbe2d433c895d1430c5f?x-bce-process=image/format,f_auto/quality,Q_70/resize,m_lfit,limit_1,w_536', 5, 1, '2025-06-08 22:39:23', '2025-06-08 22:39:23', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (1, '中华人民共和国国旗上的五颗星分别代表什么？', '中国的五个省', '共产党及四个主要阶层', '五大军种', '五个民族', 2, '五星红旗的设计寓意是中国共产党领导下的人民大团结。大五角星代表中国共产党，四颗小五角星代表工人阶级、农民阶级、小资产阶级和民族资产阶级，象征着党和人民的紧密联系。', 1, '国防常识', 1, '2025-06-03 01:56:00', '2025-06-03 01:56:00', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (2, '中国第一艘航空母舰“辽宁舰”是在什么年份正式入列？', '2009年', '2012年', '2015年', '2018年', 2, '辽宁舰是中国第一艘航空母舰，2012年正式交付海军并入列服役。', 2, '科技国防', 1, '2025-06-03 01:59:49', '2025-06-03 01:59:49', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (3, '哪位烈士在抗日战争中以身炸碉堡，壮烈牺牲？', '黄继光', '董存瑞', '邱少云', '赵一曼', 2, '董存瑞为炸毁敌碉堡，手托炸药包英勇牺牲，成为革命烈士的楷模。', 2, '烈士精神', 1, '2025-06-03 02:00:03', '2025-06-03 02:00:03', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (4, '中国空军正式成立于哪一年？', '1949年', '1951年', '1945年', '1955年', 1, '中国人民解放军空军于1949年11月11日正式成立。', 2, '国防常识', 1, '2025-06-03 02:00:17', '2025-06-03 02:00:17', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (5, '哪位女英雄在解放战争中壮烈牺牲，被誉为“女中豪杰”？', '赵一曼', '刘胡兰', '江竹筠', '邓颖超', 2, '刘胡兰在解放战争时期不畏酷刑、英勇就义，被誉为“女中豪杰”。', 2, '烈士精神', 1, '2025-06-03 02:00:43', '2025-06-03 02:00:43', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (6, '雷锋同志是哪个军种的战士？', '海军', '空军', '陆军', '火箭军', 3, '雷锋是中国人民解放军陆军工程兵的一名普通战士，因助人为乐而广为传颂。', 1, '红色人物', 1, '2025-06-03 02:00:52', '2025-06-03 02:00:52', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (7, '中国的第一颗原子弹是哪一年爆炸成功的？', '1959年', '1964年', '1971年', '1969年', 2, '中国第一颗原子弹于1964年10月16日在新疆罗布泊爆炸成功。', 2, '科技国防', 1, '2025-06-03 02:01:02', '2025-06-03 02:01:02', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (8, '以下哪位烈士在抗美援朝战场上用胸膛堵枪眼而英勇牺牲？', '杨靖宇', '邱少云', '黄继光', '董存瑞', 3, '黄继光在上甘岭战役中，用身体堵住敌人机枪口，被授予特级英雄称号。', 2, '烈士精神', 1, '2025-06-03 02:01:12', '2025-06-03 02:01:12', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (9, '“为人民服务”这句口号最早由谁提出？', '周恩来', '朱德', '毛泽东', '邓小平', 3, '“为人民服务”出自毛泽东在1944年为张思德所作悼词。', 1, '红色知识', 1, '2025-06-03 02:01:22', '2025-06-03 02:01:22', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (10, '中国人民解放军的建军节是哪一天？', '7月1日', '8月1日', '10月1日', '9月3日', 2, '中国人民解放军建军节是8月1日，源于1927年南昌起义。', 1, '国防常识', 1, '2025-06-03 02:01:33', '2025-06-03 02:01:33', NULL, NULL, 0);
INSERT INTO `knowledge_question` VALUES (11, '被誉为“两弹元勋”的科学家是谁？', '钱学森', '邓稼先', '华罗庚', '袁隆平', 2, '邓稼先是中国核武器研发的重要奠基人之一，被誉为‘两弹元勋’。', 2, '科技国防', 1, '2025-06-03 02:03:06', '2025-06-03 02:03:06', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (1, '你在校园操场上空发现一个无人机正在低空飞行并拍摄画面。', '发现可疑航拍器怎么办？', '忽视不管', '主动将其击落', '立即报告安保或公安机关', 3, '《中华人民共和国民用航空法》第九十四条：禁止在军事管理区等敏感区域非法飞行。', '遇到可疑航拍行为应立即向学校安保或公安机关报告，由专业部门依法处理。', 1, '2025-06-03 02:06:21', '2025-06-03 02:12:29', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (2, '有人在你面前试图偷拍军事训练场地。', '遇到偷拍军事设施人员应如何应对？', '劝说对方删除照片即可', '协助其拍摄留念', '立即劝阻并报警', 3, '《中华人民共和国保守国家秘密法》第十二条：禁止非法获取、持有国家秘密。', '应立即制止偷拍行为并拨打110报警，由有关部门依法处理。', 1, '2025-06-03 02:06:35', '2025-06-03 02:12:48', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (3, '你收到一封不明来源邮件，内容是提供经费换取学校军训计划资料。', '收到涉嫌窃密诱导邮件怎么办？', '无视邮件', '转发给朋友确认', '立即报告辅导员或国家安全机关', 3, '《中华人民共和国反间谍法》第十一条：发现间谍行为应及时报告。', '此类行为涉嫌间谍活动，应立即向学校或国家安全机关报告。', 1, '2025-06-03 02:06:44', '2025-06-03 02:13:20', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (4, '有人让你帮忙转发一份含有涉军内容的PDF文件。', '遇到传播涉军文件请求应如何处理？', '只要不是我写的就没事', '转发给同学参考', '拒绝转发并删除文件', 3, '《保守国家秘密法》第十条：不得非法传递涉密信息。', '应提高保密意识，拒绝转发涉军文件，防止泄密风险。', 1, '2025-06-03 02:06:56', '2025-06-03 02:13:20', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (5, '你发现有人在社交平台上传自己在军事禁区打卡的视频。', '如何正确处理发布军事禁区信息行为？', '给他点赞', '评论提醒其危险', '向平台举报或报警', 3, '《中华人民共和国刑法》第四百条：非法获取、提供军事秘密属犯罪行为', '立即通过平台举报功能或报警处理，避免扩散军事敏感信息。', 1, '2025-06-03 02:07:05', '2025-06-03 02:13:46', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (6, '同学私下邀请你参与一个“境外科研调查问卷”，询问校园军事活动安排。', '面对此类调查应如何处理？', '如实填写支持科研', '选填部分题目', '拒绝参与并报告', 3, '《中华人民共和国反间谍法》第八条：不得为间谍行为提供便利。', '境外调查可能隐藏间谍意图，需警惕并拒绝填写，向老师或国家安全机关报告。', 1, '2025-06-03 02:07:15', '2025-06-03 02:14:38', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (7, '你在旅途中拍摄自然风景时误将某军事目标入镜。', '无意拍到军事设施后应如何处理？', '继续拍摄更清晰的画面', '发到社交平台记录旅行', '立即删除相关画面', 3, '《中华人民共和国保守国家秘密法实施条例》第十七条：应主动消除不当获取的涉密信息。', '应立即删除相关照片并避免传播，防止泄露国家秘密。', 1, '2025-06-03 02:07:25', '2025-06-03 02:14:38', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (8, '你在校园里发现疑似间谍行为，例如反复蹲守教学楼或安装可疑设备。', '怀疑间谍行为应如何处理？', '自行观察收集证据', '找人一起围住', '立即报告公安或国家安全机关', 3, '《中华人民共和国反间谍法》第十一条：发现间谍行为必须立即报告。', '不可自行处理，应及时报警，由专业机关介入处置。', 1, '2025-06-03 02:07:37', '2025-06-03 02:14:38', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (9, '你看到有人在军事设施附近用航拍无人机录制短视频。', '在军事禁飞区航拍属于什么行为？', '旅游娱乐', '技术交流', '违法行为', 3, '《飞行基本规则》第十五条：禁止在禁飞区擅自飞行。', '该行为违法，应劝阻或立即向警方举报。', 1, '2025-06-03 02:07:46', '2025-06-03 02:14:58', NULL, NULL, 0);
INSERT INTO `scenario_question` VALUES (10, '在一次校园国防教育活动中，你获得了涉密级别不明的纸质材料。', '拿到疑似涉密材料应怎么处理？', '拍照存档', '带回寝室慢慢看', '交回组织者妥善处理', 3, '《中华人民共和国保守国家秘密法》第十九条：接触涉密文件须经授权。', '未经授权不得私自保留，应立即归还组织者，由其按照规定处理。', 1, '2025-06-03 02:08:01', '2025-06-03 02:15:12', NULL, NULL, 0);
